import React from "react";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import { SiteLogo, NavLinks, PhoneIcon } from "./styles/Navbar.styled";
import { Btn } from "../../styles/general/General.styled";

const Navbar = () => {
  return (
    <AppBar
      position="relative"
      sx={{
        backgroundImage: "linear-gradient(45deg, #e4efe9 0%, #93a5cf 100%);"
      }}>
      <PhoneIcon />
      <SiteLogo>OCA</SiteLogo>
      <NavLinks>
        <Btn>Features</Btn>
        <Btn>Get Chrome Extension</Btn>
        <Btn>Sign In</Btn>
      </NavLinks>
    </AppBar>
  );
};

export default Navbar;
